import style from "../Courses.module.css";
function CourseTitle(props) {
  props.setCourseTitle({ courseName: props.courseName });
  return (
    <div className={style.coutseTitle}>
      <div>Course Name</div>
      <input
        value={props.courseName}
        onInput={(evt) => props.setCourseTitle(evt.target.value)}
        type="text"
        placeholder="Course Name"
      />
    </div>
  );
}

export default CourseTitle;
